import React,{ useState} from 'react';
import { 
    Box
} from '@mui/system';
import { Dialog, DialogTitle, List, ListItem, ListItemText, Typography } from '@mui/material';


const Gopay = () =>{
    return(
    <Box
    sx={{
        display:'flex',
        flexDirection:'row',
        alignItems:'center',
        gap:'16px',
    }}>
        <Box
        component='img'
        src='./Soup/Gopay.svg'
        height='35px'
        />
        <Typography fontFamily='Poppins' fontWeight={500} fontSize='18px'>
            Gopay
        </Typography>

    </Box>
    );
};

const payment = [<Gopay/>,'OVO','DANA','Mandiri','BCA','BNI'];

const PaymentMethod = (props) => {
    const {open, setOpen} = props;
    const handleListItemClick = () => {
        setOpen(false);
      };
  return (
    <Dialog open={open} onClose={()=> setOpen(false)}>           
      <DialogTitle fontFamily='Poppins'>Select Payment Method</DialogTitle>
        <List sx={{ pt: 0 }}>

        {payment.map((payment) => (
        <ListItem button onClick={() => handleListItemClick(payment)} key={payment}>
            <ListItemText primary={payment} />
        </ListItem>
        ))}

        </List>
    </Dialog>
  )
};

export default PaymentMethod;
